import React from "react"
import * as Mui from "@mui/material"

function Register() {
    return(
        <form>
            <Mui.TextField variant="standard" name="name"/>
            <Mui.TextField variant="standard" name="username"/>
            <Mui.TextField variant="standard" name="password"/>
            <Mui.Button color="success">Register</Mui.Button>
        </form>
    )
}

export default Register
